import React, { Component } from 'react'

import {Table, Icon, Input, Row, Col, Select} from 'antd'

const colums= [{
            title: 'ID',
            dataIndex: 'article_id',
            key: 'id',
            sorter: (a,b) => a.article_id - b.article_id,
  },{
            title: 'Nom',
            dataIndex: 'firstname',
            key: 'firstname',
            sorter: (a,b) => (a.firstname).localeCompare(b.firstname),
  },{
    title: 'Prenom',
    dataIndex: 'lastname',
    key: 'lastname',
    sorter: (a,b) => (a.lastname).localeCompare(b.lastname),
},{
    title: 'Post',
    dataIndex: 'post',
    key: 'post',
    sorter: (a,b) => (a.post).localeCompare(b.post),
},{
    title: 'Nom Responsable N+1',
    dataIndex: 'respo1_first',
    key: 'respo1_first',
    sorter: (a,b) => (a.respo1_first).localeCompare(b.respo1_first),
},{
    title: 'Prenom Responsable N+1',
    dataIndex: 'respo1_last',
    key: 'respo1_last',
    sorter: (a,b) => (a.respo1_last).localeCompare(b.respo1_last),
}]

  const rows = [{
      article_id:1,
      article_title:"free algeria"
  },
  {
    article_id:3,
    article_title:"guerre national"
}]

export default class People extends Component {

    constructor(props){
        super(props)
    }

    state = {  }
    render() {
        return (
            <Table bordered dataSource={rows} columns={colums} />  
        );
    }
}
